import React from "react";


const Navbar = () => {


  return (
    <>
      <nav>
        <div className="nav-wrapper">
          <a href="#" className="left brand-logo" >Instagram</a>
          <ul id="nav-mobile" className="right  ">
            <li><a>Profile</a></li>
            <li><a>Signin</a></li>
            <li><a>Signup</a></li>
          </ul>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
